INSERT INTO `v1_f3f2d6e3524dcebb4d6e846bd6ae660be1efc427438af33a168babf35b8c6430` VALUES (24001, 102601, "あたしだって\nやるときはやるよ！", "リン", 24, "2020/04/30 12:00:00", "2030/12/17 14:59:59", 0.0, 0, 0.0, 0.0, 1, 10040, 1);
INSERT INTO `v1_f3f2d6e3524dcebb4d6e846bd6ae660be1efc427438af33a168babf35b8c6430` VALUES (24002, 102601, "ふぅ…\nこれであたしの仕事は\n終わりだね", "リン", 24, "2020/04/30 12:00:00", "2030/12/17 14:59:59", 0.0, 1, 0.0, 0.0, 1, 10040, 1);
INSERT INTO `v1_f3f2d6e3524dcebb4d6e846bd6ae660be1efc427438af33a168babf35b8c6430` VALUES (24003, 102601, "終わった終わった\n一人でもなんとか\nなるもんだね", "リン", 24, "2020/04/30 12:00:00", "2030/12/17 14:59:59", 0.0, 2, 0.0, 0.0, 1, 10040, 1);
INSERT INTO `v1_f3f2d6e3524dcebb4d6e846bd6ae660be1efc427438af33a168babf35b8c6430` VALUES (24004, 102601, "やったね！\nこれでようやく\nサボれるよ…", "リン", 24, "2020/04/30 12:00:00", "2030/12/17 14:59:59", 0.0, 3, 0.0, 0.0, 2, 10040, 2);
INSERT INTO `v1_f3f2d6e3524dcebb4d6e846bd6ae660be1efc427438af33a168babf35b8c6430` VALUES (24005, 102601, "チーズが欲しいなら\nきちんと働いて\n買いに来なよ", "リン", 24, "2020/04/30 12:00:00", "2030/12/17 14:59:59", 0.0, 4, 0.0, 0.0, 1, 10040, 1);
INSERT INTO `v1_f3f2d6e3524dcebb4d6e846bd6ae660be1efc427438af33a168babf35b8c6430` VALUES (24006, 102601, "あたしを敵に回した\n恐ろしさ\n思い知ったか！", "リン", 24, "2020/04/30 12:00:00", "2030/12/17 14:59:59", 0.0, 5, 0.0, 0.0, 2, 10040, 2);
INSERT INTO `v1_f3f2d6e3524dcebb4d6e846bd6ae660be1efc427438af33a168babf35b8c6430` VALUES (24007, 102601, "あたしも意外と\nやるもんでしょ？", "リン", 24, "2020/04/30 12:00:00", "2030/12/17 14:59:59", 0.0, 6, 0.0, 0.0, 2, 10040, 2);
INSERT INTO `v1_f3f2d6e3524dcebb4d6e846bd6ae660be1efc427438af33a168babf35b8c6430` VALUES (24008, 102601, "疲れた…\nねずみの逃げ足\n速すぎるよ…", "リン", 24, "2020/04/30 12:00:00", "2030/12/17 14:59:59", 0.0, 7, 0.0, 0.0, 4, 10040, 4);
INSERT INTO `v1_f3f2d6e3524dcebb4d6e846bd6ae660be1efc427438af33a168babf35b8c6430` VALUES (24009, 102601, "このままじゃ\nまっひ～に\n叱られちゃうよ", "リン", 24, "2020/04/30 12:00:00", "2030/12/17 14:59:59", 0.0, 8, 0.0, 0.0, 4, 10040, 4);
INSERT INTO `v1_f3f2d6e3524dcebb4d6e846bd6ae660be1efc427438af33a168babf35b8c6430` VALUES (24010, 102601, "まじめに\nやったんだけどな…\n悔しいな～", "リン", 24, "2020/04/30 12:00:00", "2030/12/17 14:59:59", 0.0, 9, 0.0, 0.0, 4, 10040, 4);
INSERT INTO `v1_f3f2d6e3524dcebb4d6e846bd6ae660be1efc427438af33a168babf35b8c6430` VALUES (24011, 102601, "やられた…\nねずみって意外と\nてごわいね", "リン", 24, "2020/04/30 12:00:00", "2030/12/17 14:59:59", 0.0, 10, 0.0, 0.0, 4, 10040, 4);
INSERT INTO `v1_f3f2d6e3524dcebb4d6e846bd6ae660be1efc427438af33a168babf35b8c6430` VALUES (24012, 102601, "おのれ～\nあたしのチーズを\n盗みやがって～！", "リン", 24, "2020/04/30 12:00:00", "2030/12/17 14:59:59", 0.0, 11, 0.0, 0.0, 4, 10040, 4);
INSERT INTO `v1_f3f2d6e3524dcebb4d6e846bd6ae660be1efc427438af33a168babf35b8c6430` VALUES (24013, 102601, "疲れた…\nけど、次こそは\n守り抜くよ…", "リン", 24, "2020/04/30 12:00:00", "2030/12/17 14:59:59", 0.0, 12, 1.81, 0.0, 1, 10040, 4);
